import '../App.css';
import {github, linkedIn, gmail, fb} from '../assets/socials';
export function Header(props) {
    return (
        <div className={props.className}>
            <img src={github} alt="github"></img>
            <img src={linkedIn} alt="linkedin"></img>
            <img> src={gmail}</img>
            
        </div>
    )
}
